import Navbar from './Navbar';
import RegistrationForm from './RegistrationForm';
import './App.css';

function RegiPage(){
    return(
            <div className="app-container">
              <Navbar />
              <div className="content-container">
                <RegistrationForm />
              </div>
            </div>
    );
}

export default RegistrationPage;
